import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import './Dashboard.css';

function Dashboard() {
    const navigate = useNavigate();
    const [averageTemp, setAverageTemp] = useState(null);
    const [period, setPeriod] = useState("2024.11.18~2024.11.24");

    useEffect(() => {
        const fetchTemperature = async () => {
            try {
                const mockData = {
                    averageTemp: (Math.random() * 10 + 15).toFixed(1) + "°C",
                };
                setAverageTemp(mockData.averageTemp);
            } catch (error) {
                console.error("온도 데이터를 가져오는 중 오류 발생:", error);
            }
        };

        fetchTemperature();
        const interval = setInterval(fetchTemperature, 60000);
        return () => clearInterval(interval);
    }, []);

    const handleSoloWrite = () => navigate('api/diary/create');
    const handleStatsPage = () => navigate('/Statistics');

    return (
        <div className="dashboard-container">
            <WelcomeSection handleSoloWrite={handleSoloWrite} />
            <div className="main-content">
                <StatsSection 
                    averageTemp={averageTemp} 
                    period={period} 
                    handleStatsPage={handleStatsPage} 
                />
                <BottomSection />
            </div>
        </div>
    );
}

function WelcomeSection({ handleSoloWrite }) {
    return (
        <div className="welcome-section">
            <h1>오늘 하루를 기록해보아요</h1>
            <p>기록은 당신의 마음과 시간을 연결하는 다이어리입니다.</p>
            <p>당신의 추억을 기록해줄 FeelsLike</p>
            <div className="diary-buttons">
                <DiaryButton 
                    icon="👤" 
                    title="나 혼자 일기 쓰러가기" 
                    description="나만의 일상 일기와 질문 일기를 작성해요." 
                    onClick={handleSoloWrite} 
                />
                <DiaryButton 
                    icon="👥" 
                    title="친구와 일기 쓰러가기" 
                    description="친구들과 같이 일기를 쓰며 추억을 기록해요." 
                />
            </div>
        </div>
    );
}

function DiaryButton({ icon, title, description, onClick }) {
    return (
        <button className="diary-button" onClick={onClick}>
            <span className="user-icon">{icon}</span>
            <div className="button-content">
                <h2>{title}</h2>
                <p>{description}</p>
            </div>
            <span className="arrow">›</span>
        </button>
    );
}

function StatsSection({ averageTemp, period, handleStatsPage }) {
    return (
        <div className="stats-section">
            <div className="stats-header">
                <h3>나의 온도 평균</h3>
                <span className="view-more" onClick={handleStatsPage}>
                    연도, 월, 주별로 분석하고 싶어요 ›
                </span>
            </div>
            <div className="temperature-display">
                <span className="period">{period}</span>
                <span className="temp">이번주 평균 온도 {averageTemp}</span>
            </div>
            <div className="graph-container">
                {/* 그래프 컴포넌트 */}
            </div>
        </div>
    );
}

function BottomSection() {
    return (
        <div className="bottom-section">
            <SectionWithHeader title="나만의 캘린더" />
            <SectionWithHeader title="나의 일기 기록" />
        </div>
    );
}

function SectionWithHeader({ title }) {
    return (
        <div className={`${title.includes('캘린더') ? 'calendar' : 'diary'}-section`}>
            <div className="section-header">
                <h3>{title}</h3>
                <span className="view-more">자세히 보기 ›</span>
            </div>
            {/* 컴포넌트 내용 */}
        </div>
    );
}

export default Dashboard;
